To create a Tooltip component in Next.js using React Context that closes the previously opened Tooltip, you can follow these steps:

1. **Create a Context for managing Tooltip state**: This context will keep track of the currently open Tooltip and provide methods to open and close Tooltips.

2. **Create a Tooltip component**: This component will use the context to open and close itself.

3. **Wrap your application with the Context Provider**: This ensures that all Tooltip components have access to the same context.

Here's a step-by-step implementation:

### Step 1: Create the Context

First, create a context to manage the state of the Tooltip.

```jsx
// contexts/TooltipContext.js
import React, { createContext, useState, useContext } from 'react';

const TooltipContext = createContext();

export const TooltipProvider = ({ children }) => {
  const [currentTooltip, setCurrentTooltip] = useState(null);

  const openTooltip = (id) => {
    setCurrentTooltip(id);
  };

  const closeTooltip = () => {
    setCurrentTooltip(null);
  };

  return (
    <TooltipContext.Provider value={{ currentTooltip, openTooltip, closeTooltip }}>
      {children}
    </TooltipContext.Provider>
  );
};

export const useTooltip = () => useContext(TooltipContext);
```

### Step 2: Create the Tooltip Component

Next, create the Tooltip component that will use the context to manage its state.

```jsx
